// Render categorized skills
function renderSkillsCategories() {
    const container = document.getElementById('skillsCategories');
    if (!container) return;

    const grouped = {};
    techStack.forEach(t => {
        if (!grouped[t.cat]) grouped[t.cat] = [];
        grouped[t.cat].push(t);
    });

    let html = '';
    Object.keys(categories).forEach(cat => {
        if (!grouped[cat]) return;
        const c = categories[cat];
        html += `
        <div class="skill-category-block">
            <div class="category-title">
                <div class="category-icon">${c.icon}</div>
                <h3>${c.name}</h3>
                <span class="tech-count">${grouped[cat].length} technologies</span>
            </div>
            <div class="category-skills">
                ${grouped[cat].map(t => `
                    <div class="skill-card">
                        <div class="skill-card-icon">${t.svg}</div>
                        <span class="skill-card-name">${t.name}</span>
                    </div>
                `).join('')}
            </div>
        </div>`;
    });
    container.innerHTML = html;
}

document.addEventListener('DOMContentLoaded', renderSkillsCategories);

